package com.github.nfcforandroid.parser.ndef;import android.nfc.NdefRecord;import com.github.nfcforandroid.api.INfaParser;import com.github.nfcforandroid.api.INfaRecord;import com.github.nfcforandroid.parser.base.NfaParserAdapter;import com.github.nfcforandroid.records.factory.NfaRecordFactory;import com.github.nfcforandroid.records.ndef.UnsupportedRecord;/** * @author jefBinomed *  *         {@link INfaParser} for Unsupported data. *  *         The return value is a {@link UnsupportedRecord} */public class UnsupportedParser extends NfaParserAdapter {	UnsupportedParser() {	}	/*	 * (non-Javadoc)	 * 	 * @see com.github.nfcforandroid.parser.base.NfaParserAdapter#parseNdef(android.nfc.NdefRecord)	 */	@Override	public INfaRecord parseNdef(NdefRecord ndefRecord) {		return NfaRecordFactory.ndefFactory().unsupportedRecord(ndefRecord);	}}